import React from 'react'
import { Link } from 'react-router-dom'


const DUMMY_EVENT = [
    {id: '1', title: 'Event 1'},
    {id:'2',title:'Event 2'}
]
function EventPage() {
  return (
    <>
        <h1>Event Page</h1>
        <ul>
            {DUMMY_EVENT.map((even)=>{
                <li key={even.id}>
                    <Link to={even.id}>{even.title}</Link>
                </li>
            })}
        </ul>
    </>
  )
}

export default EventPage
